import { useHistory } from "react-router-dom";

export default props => {

    const history = useHistory();
    const { authorId } = props;

    const sendHome = e => {
        history.push('/');
    }

    return (
        <button className="btn btn-primary m-1" onClick={sendHome}>
            Home
        </button>
    )
}
